    a_parsed = parse_number(a)
    b_parsed = parse_number(b)

    if a_parsed is None or b_parsed is None or a_parsed == b_parsed:
        return None
    elif a_parsed > b_parsed:
        return a
    else:
        return b

def special_factorial(n):
    def factorial(x):
        if x == 0 or x == 1:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n + 1):
        result *= factorial(i)

    return result

